import React from 'react'

const colorBox = props => {
  return (
    <div>
      {props.colors.map((e)=>{<div className="d-flex flex-row w-50 mx-auto" style={{backgroundColor:{e}}}>e</div>}
      )}
    </div>
  )
}

export default colorBox
